import { createTheme } from '@mui/material/styles';


const lightTheme = createMuiTheme({
  palette: {
    primary: {
      main: '#388e3c',
      light: '#66bb6a',
      dark: '#2e7d32',
    },
    secondary: {
        main: '#1e88e5',
        light: '#ffee58',
        dark: '#00897b'
    }
  }
})


const darkTheme = createMuiTheme({
  palette: {
    mode: 'dark',
  }
})

export default lightTheme;
